import  React  from 'react'
import data from "./InfosData.JSON"

export const List = (props) => {
    return (
        <ul>
            {data.map((item) => (
                <>
                <li key={item.id}>{item.nome}</li>
                <li key={item.id}>{item.position}</li>
                <li key={item.id}>{item.game}</li>
                </>
            ))}
        </ul>
    )
}
